import React from 'react';

const LogItem = () => {
    return (
        <div>
            <div className="date">
                <div className="month">
                    四月
                </div>
                <div className="day">
                    19
                </div>
            </div>
            <div className="content">
                <h2 className="desc">学习React</h2>
                <div className="time">40</div>
            </div>
        </div>
    );
};

export default LogItem;
